Das Foto ist von April ☀️ Zu dem Zeirpunkt dachte ich „wow ist der Bauch schon groß 🤰🏼“ 😃 Jetzt weiß ich was wirklich groß bedeutet, so kurz vorm Termin fühlt man sich wirklich so als würde man jeden Moment platzen 💣🤭 Man fühlt sich einfach komplett eingeschränkt in allem, der Bauch ist überall im Weg und ständig kommt man irgendwo gegen 😃 von den Schmerzen beim gehen mal ganz zu schweigen! Aber es sind ja wirklich nur noch gezählte Tage & für das was man am Ende in den Armen halten darf, lässt man wirklich so einiges über sich zergehen oder? 🤱🏼 

Luca ist momentan wirklich sehr anhänglich, er merkt, dass sich ganze bald etwas verändert & auch die Gespräche bekommt er mit! Klar freut er sich auf seine kleine Schwester & sagt ständig, dass er sie beschützen wird, dass er mit ihr spielt & sie küsst, doch in manchen Dingen merkt man, dass er eine Stufe zurück fällt z.B. Beim Thema trocken werden 🤷🏼‍♀️ das hat so gut geklappt und wir waren wirklich nah dran, doch seit ein paar Wochen möchte er davon nichts mehr hören oder wissen! Wir zwingen ihn aber auch nicht! Ich denke deine Zeit wird auch kommen & dann wird es auch leichter für ihn und uns! Es kommt jetzt für uns alle eine Umstellung, da möchte ich ihm nicht nichtehelich zumuten... 😏 Alles mit seiner Zeit! 
